import React, { Component } from 'react';
import './App.css';
import MyComp from "./MyComp/MyComp";
import PersonalData from "./PersonalData/PersonalData";
import StateDemo from "./state/StateDemo";
import DynamicRender from "./DynamicRender/DynamicRender";
import Repeater from "./DynamicRender/Repeater";
import ParentComp from "./compCommunication/ParentComp";
import RestDemo from "./RestAccess/RestDemo";
import ParentCompLifecycleDemo from "./compLifecycle/ParentCompLifecycleDemo";
import FormsDemo from "./forms/FormsDemo";
import MainPage from "./SPA/MainPage";
import MainPage2 from "./SPA2/MainPage";
import Comp1 from "./redux/Comp1";
import Comp2 from "./redux/Comp2";


class App extends Component {
    render() {
        return (
                <div className="App">
                    <p>hello form <b>app</b></p>
                    <MyComp name="Avi"/>
                    <PersonalData name='JASMIN' address='Hadera'/>
                    <PersonalData name='Maria' address='Tel aviv'/>
                    <PersonalData name='Yaniv' address='Herzelia'/>
                    <StateDemo />
                    <DynamicRender/>
                    <Repeater/>
                    <ParentComp/>
                    <RestDemo/>
                    <ParentCompLifecycleDemo/>
                    <FormsDemo/>
                    <MainPage/>
                    <MainPage2/>
                    <Comp1/>
                    <Comp2/>
                </div>
        );
    }
}

export default App;
